}
.achieve-wrapper .achieve-right-oveflow {
  height: 33.33333333vw;
  min-height: 33.33333333vw;
  overflow: auto;
}
.achieve-wrapper .achieve-right-oveflow::-webkit-scrollbar {
  width: 0px !important;
}
.achieve-wrapper .achieve-right-oveflow::-webkit-scrollbar-track {
  background: transparent !important;
  -webkit-border-radius: 0.52083333vw;
  border-radius: 0.52083333vw;
}
.achieve-wrapper .achieve-right-oveflow::-webkit-scrollbar-thumb {
  -webkit-border-radius: 0.52083333vw;
  border-radius: 0.52083333vw;
  background: transparent !important;
}
.achieve-wrapper .achieve-right-oveflow::-webkit-scrollbar-thumb:window-inactive {
  background: transparent !important;
}
.achieve-wrapper .achieve-left {
  position: relative;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
  text-align: center;
  padding: 3.125vw;
}
.achieve-wrapper .achieve-left > * {
  position: relative;
