  font-weight: 300;
  font-size: 1.04166667vw;
  line-height: 100%;
  letter-spacing: 0.52083333vw;
  color: #ffffff;
  margin-bottom: 0.9375vw;
}
.achieve-wrapper .achieve-left .ach-title {
  font-style: normal;
  font-weight: bold;
  font-size: 1.97916667vw;
  line-height: 100%;
  color: #ffffff;
}
.achieve-wrapper .achieve-left .ach-left-progress-line p {
  font-weight: bold;
  font-size: 1.97916667vw;
  line-height: 100%;
  color: #ffffff;
  margin-bottom: 1.25vw;
}
.achieve-wrapper .achieve-left .ach-left-progress-line p span {
  position: relative;
  bottom: 0.625vw;
  opacity: 0.4;
  font-size: 1.04166667vw;
