  position: relative;
}
.achieve-wrapper .achieve-left .ach-left-progress-line .ach-progress i {
  position: absolute;
  left: 0;
  top: 0;
  height: 100%;
  width: auto;
  background: #ffffff;
  box-shadow: 0px 0px 1.5625vw rgba(255, 255, 255, 0.85);
  border-radius: 2.60416667vw;
}
.achieve-wrapper .ach-bg-left-img {
  width: 100%;
  height: 100%;
  position: absolute;
  left: 0;
  top: 0;
  z-index: 1;
  overflow: hidden;
  border-radius: 0.41666667vw 0 0 0.41666667vw;
  opacity: 0.6;
}
.achieve-wrapper .ach-bg-left-img img {
  width: 100%;
  height: 100%;
  position: absolute;
  left: 0;
  top: 0;
  object-fit: cover;
  pointer-events: none;
  user-select: none;
}
.achieve-grid {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-gap: 1.25vw;
  padding: 2.08333333vw;
}
.achieve-grid > .achieve-item {
  width: 100%;
  min-height: 13.54166667vw;
  background: rgba(255, 255, 255, 0.05);
  border-radius: 0.3125vw;
  position: relative;
}
.achieve-grid > .achieve-item.take-achieve {
  cursor: pointer;
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
}
.achieve-grid > .achieve-item.take-achieve:hover:after {
  background: #32c771;
}
.achieve-grid > .achieve-item.take-achieve:hover:before {
  opacity: 0.2;
}
.achieve-grid > .achieve-item.take-achieve:before {
  content: "";
  position: absolute;
  left: 0;
  top: 0;
  height: 100%;
  width: 100%;
  background: #27ae60;
  opacity: 0.1;
  z-index: 10;
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
}
.achieve-grid > .achieve-item.take-achieve:after {
  content: " ";
  position: absolute;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
  padding: 0.625vw 1.25vw;
  border-radius: 0.20833333vw;
  background: #27ae60;
  color: #fff;
  text-transform: uppercase;
  letter-spacing: 0.10416667vw;
  font-size: 0.67708333vw;
  font-weight: bold;
  white-space: nowrap;
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
  z-index: 20;
}
.achieve-grid > .achieve-item.take-achieve > * {
  opacity: 0.4;
}
.achieve-grid > .achieve-item .ach-top {
  width: 100%;
  height: 4.89583333vw;
  min-height: 4.89583333vw;
  position: relative;
}
.achieve-grid > .achieve-item .ach-top > img {
  position: absolute;
  z-index: 1;
  left: 0;
  top: 0;
  width: 100%;
  border-radius: 0.3125vw 0.3125vw 0 0;
  height: 100%;
  object-fit: cover;
}
.achieve-grid > .achieve-item .ach-everyday {
