  margin-bottom: 0.625vw;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-count p {
  font-style: normal;
  font-weight: 400;
  font-size: 0.67708333vw;
  line-height: 100%;
  color: rgba(255, 255, 255, 0.4);
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-count p strong {
  font-weight: bold;
  color: #fff;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-count .ach-progress-vertical {
  width: 0.3125vw;
  height: 1.04166667vw;
  background: rgba(255, 255, 255, 0.1);
  border-radius: 1.5625vw;
  position: relative;
  margin-right: 0.625vw;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-count .ach-progress-vertical i {
  position: absolute;
  bottom: 0;
  left: 0;
  height: auto;
  width: 100%;
  border-radius: 1.5625vw;
  background: #ffffff;
  box-shadow: 0px 0px 1.5625vw rgba(255, 255, 255, 0.85);
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-title {
  width: 9.375vw;
  font-weight: bold;
  font-size: 0.83333333vw;
  line-height: 120%;
  color: #ffffff;
  margin-bottom: 0.625vw;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-text {
  width: 90%;
  margin-bottom: 0.83333333vw;
  font-style: normal;
  font-weight: normal;
  font-size: 0.67708333vw;
  line-height: 130%;
  color: #ffffff;
  opacity: 0.6;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-gift-line {
  display: flex;
  justify-content: flex-start;
  align-items: center;
  flex-wrap: wrap;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-gift-line div {
  height: 2.08333333vw;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  border: 0.05208333vw solid rgba(255, 255, 255, 0.2);
  border-radius: 0.20833333vw;
  padding: 0 0.625vw;
  font-weight: bold;
  font-size: 0.67708333vw;
  line-height: 100%;
  color: #ffffff;
  margin-right: 0.3125vw;
  margin-top: 0.20833333vw;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-gift-line div.ach-object {
  border: 0;
  position: relative;
  padding: 0;
}
.achieve-grid > .achieve-item .ach-item-content .ach-item-gift-line div.ach-object:after {
  content: "";
  position: absolute;
  left: 0;
  top: 0;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 10;
  width: 0.72916667vw;
  min-width: 0.72916667vw;
  height: 0.72916667vw;
  min-height: 0.72916667vw;
