@import "../../../assets/less/uikit";

* {
  user-select: none;
}
@main: #4fc28b;
@yellow: #e1b310;
@yellow2: #f2c94c;
@dark: #141b1f;
@red: #eb5757;
@green: #27ae60;
@green2: #6fcf97;
@orange: #f04d26;
@lightblue: #2d9cdb;


::-webkit-scrollbar {
  width: @4px;
}

::-webkit-scrollbar-track {
  background: transparent;
  -webkit-border-radius: @10px;
  border-radius: @10px;
}

::-webkit-scrollbar-thumb {
  -webkit-border-radius: @10px;
  border-radius: @10px;
  background: rgba(255, 255, 255, 0.2);
}

::-webkit-scrollbar-thumb:window-inactive {
  background: rgba(255, 255, 255, 0.2);
}

.main-menu {
  user-select: none;
  position: relative;
  //background: url('./../../Personage/assets/bg_person.jpg') no-repeat center center;
  background-size: cover;
  height: 100vh;
  font-size: @18px;
  font-weight: 400;
  line-height: 1;
  color: #fff;
  overflow: hidden;

  .binder-category__title {
    width: 74.79166667vw !important;
    font-size: 1.25vw !important;
    color: #fff !important;
  }


  button {
    border: 0;
    padding: 0;
    .anim;
    background: transparent;
    cursor: pointer;

    img {
      pointer-events: none;
      user-select: none;
    }
  }

  .send-wrap {
    img {
      width: 60%;
    }
  }

  .upper {
    text-transform: uppercase;
  }

  textarea,
  button,
  a,
  select,
  input {
    outline: none !important;
    text-decoration: none !important;
  }

  input {
    border: 0;
  }

  button,
  a {
    cursor: pointer;
    .anim;
  }

  .tl {
    text-align: left;
  }

  .tc {
    text-align: center;
  }

  .tr {
    text-align: right;
  }

  ::selection {
    background: @main;
    color: #fff;
  }

  ::-moz-selection {
    background: @main;
    color: #fff;
  }

  .anim {
    transition: all 0.33s ease-in-out;
    -webkit-transition: all 0.33s ease-in-out;
    -moz-transition: all 0.33s ease-in-out;
  }

  .animlong {
    transition: all 0.4s linear;
    -webkit-transition: all 0.4s linear;
    -moz-transition: all 0.4s linear;
  }

  p {
    margin: 0;
    position: relative;
    font-variant: none;
  }

  a {
    cursor: pointer;

    &:hover {
      text-decoration: none;
    }
  }

  .br4 {
    border-radius: @4px;
  }

  .br6 {
    border-radius: @6px;
  }

  .centercenter {
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
  }

  .grid-img {
    position: absolute;
    left: 0;
    top: 0;
    pointer-events: none;
    user-select: none;
    opacity: 0.05;

    img {
      width: 100vw;
      height: auto;
    }
