.time-gaming-wrapper {
  width: 100%;
  height: @80px + @8px;
  background: rgba(255, 255, 255, 0.05);
  border-radius: @4px;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  margin-bottom: @12px;

  & p {
    font-style: normal;
    font-size: @14px;
    line-height: 140%;
    color: #ffffff;

    strong {
      font-weight: bold;
    }

    span {
      opacity: 0.4;
    }
  }

  & .time-gaming-wrapper-gift {
    border-radius: @4px;
    background: #f04d26;
    display: flex;
    align-items: center;
    justify-content: center;
    width: @80px + @8px;
    min-width: @80px + @8px;
    margin-right: @14px;
    height: @80px + @8px;
    position: relative;

    & img {
      width: @30px;
      position: absolute;
      left: 0;
      top: 0;
      width: 100%;
      height: 100%;
      background-size: cover;
      border-radius: @4px 0 0 @4px;
    }
  }
}

.anim {
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
}

.achieve-wrapper {
  width: @1440px;
  height: @640px;
  min-height: @640px;
  background: rgba(20, 27, 31, 0.95);
  border-radius: @8px;
  display: grid;
  grid-template-columns: 20.83333333vw 1fr;
  grid-gap: 0;
  height: 100%;

  .achieve-right-oveflow {
    height: @640px;
    min-height: @640px;
    overflow: auto;

    &::-webkit-scrollbar {
      width: 0px !important;
    }

    &::-webkit-scrollbar-track {
      background: transparent !important;
      -webkit-border-radius: @10px;
      border-radius: @10px;
    }

    &::-webkit-scrollbar-thumb {
      -webkit-border-radius: @10px;
      border-radius: @10px;
      background: transparent !important;
    }

    &::-webkit-scrollbar-thumb:window-inactive {
      background: transparent !important;
    }
  }

  .achieve-left {
    position: relative;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
    text-align: center;
    padding: @60px;

    & > * {
      position: relative;
      z-index: 20;
    }

    & > img {
      height: @40px;
    }

    .ach-your {
      font-style: normal;
      font-weight: 300;
      font-size: @20px;
      line-height: 100%;
      letter-spacing: @10px;
      color: #ffffff;
      margin-bottom: @18px;
    }

    .ach-title {
      font-style: normal;
      font-weight: bold;
      font-size: @38px;
      line-height: 100%;
      color: #ffffff;
    }

    .ach-left-progress-line {
      p {
        font-weight: bold;
        font-size: @38px;
        line-height: 100%;
        color: #ffffff;
        margin-bottom: @24px;

        span {
          position: relative;
          bottom: @12px;
          opacity: 0.4;
          font-size: @20px;
          font-weight: 400;
        }
      }

      .ach-progress {
        width: @220px;
        height: @6px;
        border-radius: @50px;
        background: rgba(255, 255, 255, 0.2);
        position: relative;

        i {
          position: absolute;
          left: 0;
          top: 0;
          height: 100%;
          width: auto;
          background: #ffffff;
          box-shadow: 0px 0px @30px rgba(255, 255, 255, 0.85);
          border-radius: @50px;
        }
      }
    }
  }

  .ach-bg-left-img {
    width: 100%;
    height: 100%;
    position: absolute;
    left: 0;
    top: 0;
    z-index: 1;
    overflow: hidden;
    border-radius: @8px 0 0 @8px;
    opacity: 0.6;

    img {
      width: 100%;
      height: 100%;
      position: absolute;
      left: 0;
      top: 0;
      object-fit: cover;
      pointer-events: none;
      user-select: none;
    }
  }
}

.achieve-grid {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-gap: @24px;
  padding: @40px;

  & > .achieve-item {
    width: 100%;
    min-height: @260px;
    background: rgba(255, 255, 255, 0.05);
    border-radius: @6px;
    position: relative;

    &.take-achieve {
      cursor: pointer;
      .anim;

      &:hover {
        &:after {
          background: #32c771;
        }

        &:before {
          opacity: 0.2;
        }
      }

      &:before {
        content: "";
        position: absolute;
        left: 0;
        top: 0;
        height: 100%;
        width: 100%;
        background: rgba(39, 174, 96, 1);
        opacity: 0.1;
        z-index: 10;
        .anim;
      }

      &:after {
        content: " ";
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        padding: @12px @24px;
        border-radius: @4px;
        background: #27ae60;
        color: #fff;
        text-transform: uppercase;
        letter-spacing: @2px;
        font-size: @13px;
        font-weight: bold;
        white-space: nowrap;
        .anim;
        z-index: 20;
      }

      & > * {
        opacity: 0.4;
      }
    }

    .ach-top {
      width: 100%;
      height: @94px;
      min-height: @94px;
      position: relative;

      & > img {
        position: absolute;
        z-index: 1;
        left: 0;
        top: 0;
        width: 100%;
        border-radius: @6px @6px 0 0;
        height: 100%;
        object-fit: cover;
      }
    }

    .ach-everyday {
      padding: @4px;
      background: #f2c94c;
      border-radius: @4px;
      color: #141b1f;
      display: flex;
      align-items: center;
      justify-content: flex-start;
      position: absolute;
      z-index: 10;
      left: @16px;
      font-size: @10px;
      font-weight: bold;
      line-height: 100%;
      top: @16px;
      text-transform: uppercase;

      img {
        width: @12px;
        height: @12px;
        min-width: @12px;
        margin-right: @2px;
      }
    }

    .ach-item-content {
      padding: @24px;
      position: relative;
      cursor: default;

      .ach-item-count {
        position: relative;
        z-index: 100;
        white-space: nowrap;
        display: flex;
        justify-content: flex-start;
        align-items: center;
        text-align: center;
        align-items: center;
        margin-bottom: @12px;

        p {
          font-style: normal;
          font-weight: 400;
          font-size: @13px;
          line-height: 100%;
          color: rgba(255, 255, 255, 0.4);

          strong {
            font-weight: bold;
            color: #fff;
          }
        }

        .ach-progress-vertical {
          width: @6px;
          height: @20px;
          background: rgba(255, 255, 255, 0.1);
          border-radius: @30px;
          position: relative;
          margin-right: @12px;

          i {
            position: absolute;
            bottom: 0;
            left: 0;
            height: auto;
            width: 100%;
            border-radius: @30px;
            background: #ffffff;
            box-shadow: 0px 0px @30px rgba(255, 255, 255, 0.85);
          }
        }
      }

      .ach-item-title {
        width: @180px;
        font-weight: bold;
        font-size: @16px;
        line-height: 120%;
        color: #ffffff;
        margin-bottom: @12px;
      }

      .ach-item-text {
        width: 90%;
        margin-bottom: @16px;
        font-style: normal;
        font-weight: normal;
        font-size: @13px;
        line-height: 130%;
        color: #ffffff;
        opacity: 0.6;
      }

      .ach-item-gift-line {
        display: flex;
        justify-content: flex-start;
        align-items: center;
        flex-wrap: wrap;

        div {
          height: @40px;
          display: flex;
          align-items: center;
          justify-content: center;
          text-align: center;
          border: @1px solid rgba(255, 255, 255, 0.2);
          border-radius: @4px;
          padding: 0 @12px;
          font-weight: bold;
          font-size: @13px;
          line-height: 100%;
          color: #ffffff;
          margin-right: @6px;
          margin-top: @4px;

          &.ach-object {
            border: 0;
            position: relative;
            padding: 0;

            &:after {
              content: "";
              position: absolute;
              left: 0;
              top: 0;
              border-radius: 50%;
              display: flex;
              align-items: center;
              justify-content: center;
              z-index: 10;
              width: @14px;
              min-width: @14px;
              height: @14px;
              min-height: @14px;
              padding: 0;
              background: #fff url(./achievements/plus.svg) no-repeat center
                center;
              background-size: 80% 80%;
            }

            & > img {
              width: @40px;
              position: relative;
              z-index: 1;
              height: @40px;
            }
          }
        }
      }
    }

    &.success {
      background: rgba(39, 174, 96, 0.05);

      .ach-top {
        &:after {
          content: "";
          width: @24px;
          height: @24px;
          background: url(./achievements/success.svg) no-repeat center center;
          background-size: 100% 100%;
          position: absolute;
          left: 50%;
          top: 50%;
          transform: translate(-50%, -50%);
          z-index: 10;
        }

        & > img {
          opacity: 0.6;
        }

        .ach-everyday {
          background: #27ae60;
        }
      }

      .ach-item-title,
      .ach-item-text {
        color: #27ae60;
      }

      .ach-item-gift-line {
        div {
          border-color: #27ae60;
          color: #27ae60;

          &.ach-object {
            border: 0;

            &:after {
              background: #27ae60 url(./achievements/success-white.svg)
                no-repeat center center;
            }
          }
        }
      }

      .ach-item-count {
        p {
          color: #27ae60;

          strong {
            color: #27ae60;
          }
        }

        .ach-progress-vertical {
          opacity: 0;
        }
      }
    }
  }
}

